import React from "react";

const Service = () => {
  return (
    <>
      <div className="my-5">
        <h1>Our Services</h1>
      </div>

      <div className="contianer-fluid nav_bg">
        <div className="row">
            <div className="col-10 mx-auto">
               <div className="row"></div>
            </div>
        </div>
      </div> 
    </>
  );
};

export default Service;
